INSERT INTO `tbl_blog_post_lang` (`postlang_post_id`, `postlang_lang_id`, `post_author_name`, `post_title`, `post_short_description`, `post_description`) VALUES
(4, 1, 'Fatbit', 'The Ultimate Guide to Starting Your eLearning Business', 'Being a flexible business model for eLearning, it can be easily adapted by most online schools or teaching institutes. Catering to a myriad of eLearning businesses over the last few years, this model is considered to be ideal.', '\r\n<h2 id=\"Selecting-the-Appropriate-Business-Model\" style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 2.25em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none;\">Selecting the Appropriate Business Model&nbsp;</span></h2>\r\n<h2 style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 2.25em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"></h2>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Before you decide to launch an eLearning business, it’s recommended to consider the business models associated with it. There are 2 types of business models in eLearning and based on the business you would like to run, you can choose the one that matches your needs:</span></p>\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 10px 0px; list-style: none; padding: 0px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; border: 0px; font-family: Poppins, sans-serif; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The \"Night School” Model</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The \"Academy” Model</span></li>\r\n</ul>\r\n<h3 style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 1.875em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none;\">The \"Night School” Model</span></h3>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Considered as a classic business model for eLearning, it’s been widely used in most of the schools and institutions around the world. In this business model, learners have to pay an up-front fee only once for gaining access. There is a fixed curriculum from beginning till the end which learners have to follow while their progression is effectively tracked with the help of quizzes/tests. The best part about this business model is it doesn’t let you deviate from the main topic or involves any \"extras” (except for the additionally bought ones).<br style=\"box-sizing: border-box; outline: none;\" />\r\n		</span><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">As far as the selling of the courses is concerned, there is no defined limit. It’s usually advised to develop one that solves the major issues of your audience. Depending on the content and the utility of the courses, you can sell them from $10 to $5000 or even more.</span></p>\r\n<h4 style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 1.5em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none;\">Who is it Ideal for?<br style=\"box-sizing: border-box; outline: none;\" />\r\n		</span></h4>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Being a flexible business model for eLearning, it can be easily adapted by most online schools or teaching institutes. Catering to a myriad of eLearning businesses over the last few years, this model is considered to be ideal for:</span></p>\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 10px 0px; list-style: none; padding: 0px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; border: 0px; font-family: Poppins, sans-serif; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">New businesses as it helps to test your products and get feedback from your audience.&nbsp;</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">High-ticket businesses that involve selling products at a one-off value of $2000+ or more.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Online businesses that include selling one-off courses without the support of a \"school” environment.&nbsp; &nbsp; &nbsp;&nbsp;</span></li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\">However, there are some cons to choosing this method which involves:</p>\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 10px 0px; list-style: none; padding: 0px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; border: 0px; font-family: Poppins, sans-serif; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The consistent launch and relaunch of products is required to update the course content</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">To get results, you need to create high-quality courses that involve more time and effort</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">As every course has a unique sales funnel, you need to create multiple funnels for every course</span></li>\r\n</ul>'),
(4, 2, 'الدهون', 'الدليل النهائي لبدء عملك في التعليم الإلكتروني', 'كونه نموذج عمل مرنًا للتعليم الإلكتروني ، يمكن تكييفه بسهولة من قبل معظم المدارس أو المعاهد التعليمية عبر الإنترنت. يلبي احتياجات عدد لا يحصى من أعمال التعليم الإلكتروني على مدار السنوات القليلة الماضية ، يعتبر هذا النموذج مثاليًا', '\r\n<h2 id=\"Selecting-the-Appropriate-Business-Model\" style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 2.25em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none;\"></span></h2>\r\n<div>اختيار نموذج العمل المناسب</div>\r\n<div>قبل أن تقرر إطلاق نشاط تجاري للتعليم الإلكتروني ، من المستحسن النظر في نماذج الأعمال المرتبطة به. هناك نوعان من نماذج الأعمال في التعليم الإلكتروني وبناءً على العمل الذي ترغب في إدارته ، يمكنك اختيار النموذج الذي يلائم احتياجاتك:</div>\r\n<div><br />\r\n	</div>\r\n<div>نموذج \"المدرسة الليلية\"</div>\r\n<div>نموذج \"الأكاديمية\"</div>\r\n<div>نموذج \"المدرسة الليلية\"</div>\r\n<div>يعتبر نموذج الأعمال الكلاسيكي للتعليم الإلكتروني ، وقد تم استخدامه على نطاق واسع في معظم المدارس والمؤسسات حول العالم. في نموذج العمل هذا ، يتعين على المتعلمين دفع رسوم مقدمة مرة واحدة فقط للوصول. هناك منهج ثابت من البداية حتى النهاية يجب على المتعلمين اتباعه بينما يتم تتبع تقدمهم بفعالية بمساعدة الاختبارات / الاختبارات. أفضل جزء في نموذج العمل هذا هو أنه لا يسمح لك بالابتعاد عن الموضوع الرئيسي أو يتضمن أي \"إضافات\" (باستثناء ما تم شراؤه بشكل إضافي).</div>\r\n<div>فيما يتعلق ببيع الدورات ، لا يوجد حد محدد. يُنصح عادةً بتطوير واحد يحل المشكلات الرئيسية لجمهورك. اعتمادًا على المحتوى وفائدة الدورات التدريبية ، يمكنك بيعها من 10 دولارات إلى 5000 دولار أو أكثر.</div>\r\n<div><br />\r\n	</div>\r\n<div>لمن هو مثالي؟</div>\r\n<div>كونه نموذج عمل مرنًا للتعليم الإلكتروني ، يمكن تكييفه بسهولة من قبل معظم المدارس أو المعاهد التعليمية عبر الإنترنت. يلبي هذا النموذج عددًا لا يحصى من أعمال التعليم الإلكتروني على مدار السنوات القليلة الماضية ، ويعتبر مثاليًا من أجل:</div>\r\n<div><br />\r\n	</div>\r\n<div>الأعمال التجارية الجديدة لأنها تساعد في اختبار منتجاتك والحصول على تعليقات من جمهورك.</div>\r\n<div>الشركات ذات التذاكر العالية التي تتضمن بيع منتجات بقيمة لمرة واحدة تزيد عن 2000 دولار أو أكثر.</div>\r\n<div>الأعمال التجارية عبر الإنترنت التي تشمل بيع الدورات التدريبية لمرة واحدة دون دعم من بيئة \"المدرسة\".</div>\r\n<div>ومع ذلك ، هناك بعض السلبيات لاختيار هذه الطريقة والتي تشمل:</div>\r\n<div><br />\r\n	</div>\r\n<div>مطلوب الإطلاق المتسق للمنتجات وإعادة إطلاقها لتحديث محتوى الدورة</div>\r\n<div>للحصول على نتائج ، تحتاج إلى إنشاء دورات تدريبية عالية الجودة تتطلب المزيد من الوقت والجهد</div>\r\n<div>نظرًا لأن كل دورة تدريبية لها مسار مبيعات فريد ، فأنت بحاجة إلى إنشاء مسارات تحويل متعددة لكل دورة تدريبية</div>\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 10px 0px; list-style: none; padding: 0px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; border: 0px; font-family: Poppins, sans-serif; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 8px 24px; color: rgb(85, 85, 85); margin: 0px; border: 0px; line-height: 30px; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\"></span></li>\r\n</ul>'),
(5, 1, 'Fatbit', 'How To Launch An Online Coaching Business & Start Scaling', 'Going digital surely pay dividends to keep the business afloat & generate revenue by offering coaching sessions to multiple students online. eCoaching is an excellent business model that enables you to register coaches and provide online coaching classes to thousands of students as opposed to a limited few in case of traditional coaching sessions.', '\r\n<h2 style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 2.25em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\">Why Should You Choose Online Coaching Business</h2>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">As most of the coaches are drifting towards online models to significantly expand their target market, choosing an online coaching business has become a necessity nowadays. It enables you to seamlessly connect and provide coaching to students worldwide even during the pandemic.&nbsp;</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">eCoaching is an excellent business model that enables you to register coaches and provide online coaching classes to thousands of students as opposed to a limited few in case of traditional coaching sessions. Plus, there are no time constraints as students can select coaching sessions as per their availability.</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(44, 182, 201); line-height: 1.6; font-size: 24px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><em style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px; font-weight: 700;\">\"</span>Going digital surely pay dividends to keep the business afloat &amp; generate revenue by offering coaching sessions to multiple students online.<span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px; font-weight: 700;\">\"</span></em></p>\r\n<h2 style=\"box-sizing: border-box; outline: none; margin: 25px 0px 10px; line-height: 1.2; color: rgb(51, 51, 51); font-size: 2.25em; padding: 0px 0px 10px; border: 0px; font-family: Poppins, sans-serif; clear: both; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none;\">Business Model&nbsp;</span></h2>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">An online coaching marketplace&nbsp;</span><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">connects students with potential coaches in a 1-on-1 live session. Amid the pandemic as most schools and educational institutes are shut, the eCoaching platform is the perfect setup to simulate a real-life learning environment. The marketplace offers detailed information like coaching expertise, ratings &amp; reviews, and more to help students find the right coach.</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The working model for the eCoaching business is pretty simple and similar to an eLearning platform.</span></p>\r\n<ol style=\"box-sizing: border-box; outline: none; margin: 10px 0px 10px 20px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; list-style: none; padding: 0px; border: 0px; font-family: Poppins, sans-serif; width: 803px; display: inline-block; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The student will sign-up on the platform.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Create a learner account.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Search from the listed coaching experts and send a session booking request.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Make a payment.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Receive a booking confirmation.</span></li>\r\n</ol><span style=\"box-sizing: border-box; outline: none; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"></span><span nunito=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"></span>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Coaches follow a similar process with sign-up or registration&nbsp;</span></p>\r\n<ol style=\"box-sizing: border-box; outline: none; margin: 10px 0px 10px 20px; color: rgb(102, 102, 102); line-height: 1.9; font-size: 16px; list-style: none; padding: 0px; border: 0px; font-family: Poppins, sans-serif; width: 803px; display: inline-block; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Coach profile creation.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Profile is listed post admin approval.&nbsp;</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Receive a session booking request.&nbsp;</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; position: relative; padding: 0px 0px 10px; color: var(--body-color); margin: 0px; border: 0px; list-style: outside decimal; line-height: normal; letter-spacing: 0.02em;\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">Accept or reject the request as per the availability.</span></li>\r\n</ol><span style=\"box-sizing: border-box; outline: none; color: rgb(102, 102, 102); font-family: Poppins, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"></span><span nunito=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"></span>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">The online coaching session starts at a specified time agreed by both parties (i.e. student and coach).</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 15px; color: rgb(85, 85, 85); line-height: 1.6; font-size: 16px; font-family: Poppins, sans-serif; padding: 0px 0px 15px; border: 0px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; outline: none; margin: 0px; padding: 0px; border: 0px;\">P.S. The admin receives payment before the coaching session begins but transfers it to the coach’s wallet once the session is successfully completed and after deducting the commission fee.</span></p>'),
(5, 2, 'الدهون', 'كيفية إطلاق مشروع تدريب عبر الإنترنت وبدء التوسع', 'من المؤكد أن التحول إلى التكنولوجيا الرقمية يحقق أرباحًا للحفاظ على العمل قائمًا وتحقيق إيرادات من خلال تقديم جلسات تدريب لعدة طلاب عبر الإنترنت.يعد ه التدريب نموذجًا تجاريًا ممتازًا يمكّنك من تسجيل المدربين وتقديم دروس تدريب عبر الإنترنت لآلاف الطلاب بدلاً من عدد محدود في حالة جلسات التدريب التقليدية.', '\r\n<div>لماذا يجب عليك اختيار أعمال التدريب عبر الإنترنت</div>\r\n<div>نظرًا لأن معظم المدربين ينجرفون نحو النماذج عبر الإنترنت لتوسيع سوقهم المستهدف بشكل كبير ، فقد أصبح اختيار أعمال التدريب عبر الإنترنت ضرورة في الوقت الحاضر. يمكّنك من الاتصال بسلاسة وتوفير التدريب للطلاب في جميع أنحاء العالم حتى أثناء الوباء.</div>\r\n<div><br />\r\n	</div>\r\n<div>يعد التدريب الإلكتروني نموذجًا تجاريًا ممتازًا يمكّنك من تسجيل المدربين وتقديم دروس تدريب عبر الإنترنت لآلاف الطلاب بدلاً من عدد محدود في حالة جلسات التدريب التقليدية. بالإضافة إلى ذلك ، لا توجد قيود زمنية حيث يمكن للطلاب اختيار جلسات التدريب حسب توفرهم.</div>\r\n<div><br />\r\n	</div>\r\n<div>\"من المؤكد أن التحول إلى التكنولوجيا الرقمية يحقق أرباحًا للحفاظ على نشاطك التجاري قائمًا وتحقيق إيرادات من خلال تقديم جلسات تدريب لعدة طلاب عبر الإنترنت.</div>\r\n<div><br />\r\n	</div>\r\n<div>نموذج العمل</div>\r\n<div>يربط سوق التدريب عبر الإنترنت الطلاب بالمدربين المحتملين في جلسة مباشرة فردية. وسط الوباء حيث أغلقت معظم المدارس والمؤسسات التعليمية ، فإن منصة التدريب الإلكتروني هي الإعداد المثالي لمحاكاة بيئة التعلم الواقعية. يقدم السوق معلومات مفصلة مثل خبرة التدريب والتقييمات والمراجعات والمزيد لمساعدة الطلاب في العثور على المدرب المناسب.</div>\r\n<div><br />\r\n	</div>\r\n<div>نموذج العمل الخاص بأعمال التدريب الإلكتروني بسيط جدًا ومشابه لمنصة التعليم الإلكتروني.</div>\r\n<div><br />\r\n	</div>\r\n<div>سيقوم الطالب بالتسجيل على المنصة.</div>\r\n<div>قم بإنشاء حساب متعلم.</div>\r\n<div>ابحث من خبراء التدريب المدرجين وأرسل طلب حجز جلسة.</div>\r\n<div>أتم عملية الدفع.</div>\r\n<div>تلقي تأكيد الحجز.</div>\r\n<div>يتبع المدربون عملية مماثلة مع التسجيل أو التسجيل</div>\r\n<div><br />\r\n	</div>\r\n<div>إنشاء ملف تعريف المدرب.</div>\r\n<div>الملف الشخصي مدرج بعد موافقة المسؤول.</div>\r\n<div>تلقي طلب حجز جلسة.</div>\r\n<div>قبول أو رفض الطلب حسب التوافر.</div>\r\n<div>تبدأ جلسة التدريب عبر الإنترنت في وقت محدد يتفق عليه الطرفان (أي الطالب والمدرب).</div>\r\n<div><br />\r\n	</div>\r\n<div>ملاحظة. يتلقى المسؤول المبلغ قبل بدء جلسة التدريب ولكنه ينقلها إلى محفظة المدرب بمجرد اكتمال الجلسة بنجاح وبعد خصم رسوم العمولة.</div>');
