INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_vars`, `etpl_status`, `etpl_quick_send`) VALUES
('account_credited_debited', 1, 'Credit/Debit Transaction Email', 'Your account has been {txn_type} on {website_name}', '\r\n<table width=\"600\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">    \r\n	<tbody>        \r\n		<tr>            \r\n			<td style=\"background:#fff;padding:0 40px; text-align:center; color:#999;vertical-align:top; border-bottom:1px solid #eee;\">                \r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \r\n					<tbody>                        \r\n						<tr>                            \r\n							<td style=\"padding:20px 0;\">                                \r\n								<h5 style=\"margin: 0;padding: 0; text-transform: uppercase; font-size: 16px;font-weight: 500;color: #333;\">                                </h5>                                \r\n								<h2 style=\"margin:8px 0 0;padding: 0; font-size:30px;font-weight: 700;color: {primary-color};text-align:center;\">                                    Account Transaction</h2>                            </td>                        \r\n						</tr>                    \r\n					</tbody>                \r\n				</table>            </td>        \r\n		</tr>        \r\n		<tr>            \r\n			<td style=\"background:#fff;padding:0 40px; text-align:left; color:#999;vertical-align:top; border-bottom:1px solid #eee; \">                \r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \r\n					<tbody>                        \r\n						<tr>                            \r\n							<td style=\"padding:40px 0 60px;\">                                \r\n								<h3 style=\"margin: 0 0 30px;font-size: 24px; font-weight: 500; padding: 0;color: #333;text-align: center;\">                                    Dear {user_full_name}</h3>                                \r\n								<p style=\"font-size: 14px; line-height: 20px;color: #676767;\">Your account has been\r\n                                    {txn_type} with the transaction of amount {txn_amount}. Below are the complete\r\n                                    transaction details:</p>                                \r\n								<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">                                    \r\n									<tbody>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">ID</td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_id}</td>                                        \r\n										</tr>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Amount<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_amount}</td>                                        \r\n										</tr>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Comment</td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_comments}</td>                                        \r\n										</tr>                                    \r\n									</tbody>                                \r\n								</table>                            </td>                        \r\n						</tr>                    \r\n					</tbody>                \r\n				</table>            </td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_first_name} First Name of the email receiver.<br />\r\n{user_last_name} Last Name of the email receiver.<br />\r\n{user_full_name} Full Name of the email receiver.<br />\r\n{txn_type} - Credited or Debited<br>{txn_id} - Transaction ID<br/>{txn_amount} - Transaction Amount<br>{txn_comments} - Transaction Comments<br>', 1, 1),
('account_credited_debited', 2, 'البريد الإلكتروني لمعاملة الائتمان / الخصم', 'كان حسابك {txn_type} على {website_name}', '\n<table width=\"600\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">    \n	<tbody>        \n		<tr>            \n			<td style=\"background:#fff;padding:0 40px; text-align:center; color:#999;vertical-align:top; border-bottom:1px solid #eee;\">                \n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \n					<tbody>                        \n						<tr>                            \n							<td style=\"padding:20px 0;\">                                \n								<h5 style=\"margin: 0;padding: 0; text-transform: uppercase; font-size: 16px;font-weight: 500;color: #333;\">                                </h5>                                \n								<h2 style=\"margin:8px 0 0;padding: 0; font-size:30px;font-weight: 700;color: {primary-color};text-align:center;\">                                    Account Transaction</h2>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>        \n		<tr>            \n			<td style=\"background:#fff;padding:0 40px; text-align:left; color:#999;vertical-align:top; border-bottom:1px solid #eee; \">                \n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \n					<tbody>                        \n						<tr>                            \n							<td style=\"padding:40px 0 60px;\">                                \n								<h3 style=\"margin: 0 0 30px;font-size: 24px; font-weight: 500; padding: 0;color: #333;text-align: center;\">                                    Dear {user_full_name}</h3>                                \n								<p style=\"font-size: 14px; line-height: 20px;color: #676767;\">Your account has been\n                                    {txn_type} with the transaction of amount {txn_amount}. Below are the complete\n                                    transaction details:</p>                                \n								<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">                                    \n									<tbody>                                        \n										<tr>                                            \n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">ID</td>                                            \n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_id}</td>                                        \n										</tr>                                        \n										<tr>                                            \n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Amount<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>                                            \n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_amount}</td>                                        \n										</tr>                                        \n										<tr>                                            \n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Comment</td>                                            \n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{txn_comments}</td>                                        \n										</tr>                                    \n									</tbody>                                \n								</table>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>    \n	</tbody>\n</table>', '{user_first_name} First Name of the email receiver.<br>\n{user_last_name} Last Name of the email receiver.<br>\n{user_full_name} Full Name of the email receiver.<br>\n{txn_type} - Credited or Debited<br>\n{txn_id} - Transaction ID<br>\n{txn_amount} - Transaction Amount<br>\n{txn_comments} - Transaction Comments<br>', 1, 1),
('admin_closed_issue', 1, 'Issue Closed By Admin Email To Teacher & Learner', 'Issue Closed', '\r\n<table width=\"600\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">    \r\n	<tbody>        \r\n		<tr>            \r\n			<td style=\"background:#fff;padding:0 40px; text-align:center; color:#999;vertical-align:top; border-bottom:1px solid #eee;\">                \r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \r\n					<tbody>                        \r\n						<tr>                            \r\n							<td style=\"padding:20px 0;\">                                \r\n								<h5 style=\"margin: 0;padding: 0; text-transform: uppercase; font-size: 16px;font-weight: 500;color: #333;\">                                </h5>                                \r\n								<h2 style=\"margin:8px 0 0;padding: 0; font-size:30px;font-weight: 700;color: {primary-color};text-align:center;\">                                    Issue Closed</h2>                            </td>                        \r\n						</tr>                    \r\n					</tbody>                \r\n				</table>            </td>        \r\n		</tr>        \r\n		<tr>            \r\n			<td style=\"background:#fff;padding:0 40px; text-align:left; color:#999;vertical-align:top; border-bottom:1px solid #eee; \">                \r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                    \r\n					<tbody>                        \r\n						<tr>                            \r\n							<td style=\"padding:40px 0 60px;\">                                \r\n								<h3 style=\"margin: 0 0 10px;font-size: 24px; font-weight: 500; padding: 0;color: #333;text-align:center;\">                                    Dear {user_name}</h3>                                \r\n								<p style=\"font-size: 14px;line-height: 20px;color: #676767;\">An escalated issue reported\r\n                                    for {session_type} \"{class_lesson_name}\" has been marked closed by Admin.</p>                                \r\n								<p style=\"font-size: 14px;line-height: 20px;color: #676767;\">Below are the complete\r\n                                    details with resolution from Admin:</p>                                \r\n								<table style=\"border:1px solid #ddd; border-collapse:collapse; width:100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">                                    \r\n									<tbody>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"40%\">{session_type} Name</td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"60%\">{class_lesson_name}</td>                                        \r\n										</tr>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"40%\">Scheduled On</td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"60%\">{schedule_date} {start_time} - {end_time}</td>                                        \r\n										</tr>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"40%\">Resolution</td>                                            \r\n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"60%\">{resolution_action}</td>                                        \r\n										</tr>                            