:#999;vertical-align:top;\">                                \r\n								<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                                    \r\n									<tbody>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:30px 0; font-size:20px; color:#000; text-align:center;\">                                                Need more help?<br />\r\n												                                                <a href=\"{contact_us_url}\" style=\"color:{primary-color};\">We‘re here,\r\n                                                    ready to talk</a>                                            </td>                                        \r\n										</tr>                                    \r\n									</tbody>                                \r\n								</table>                            </td>                        \r\n						</tr>                        \r\n						<tr>                            \r\n							<td style=\"background:rgba(0,0,0,0.04); padding:0 40px; color:#999;vertical-align:top; line-height:20px; text-align: center;\">                                \r\n								<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\">                                    \r\n									<tbody>                                        \r\n										<tr>                                            \r\n											<td style=\"padding:20px 0 30px; font-size:13px; color:#999; text-align:center;\">                                                Be sure to add <a href=\"#\" style=\"color: {primary-color}\">{notifcation_email}</a> to your\r\n                                                address book or safe sender list so our emails get to your inbox.<br />\r\n												                                                <br />\r\n												                                                &copy; {current_year}, {website_