nt-size: 14px; line-height: 20px;color: #676767;\">Your Gift card code is <span style=\" border: 3px dotted #ddd;padding: 5px 10px;font-weight: bold\">{giftcard_code}</span></p>                                                                \n								<p style=\"font-size: 14px; line-height: 20px;color: #676767;\"><br />\n									In order to redeem your gift, please visit the <a style=\"color: {primary-color}\" href=\"{website_url}\">{website_name}</a></p>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>    \n	</tbody>\n</table>', '{recipient_name} Receiver name<br>\n{sender_name} Sender name<br>\n{giftcard_code} Gift Card Code<br>\n{website_name} Website name<br>', 1, 0),
