_code}</p>                            </td>                        \r\n						</tr>                    \r\n					</tbody>                \r\n				</table>            </td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{sender_name} Sender name<br>\r\n{receiver_name} Receiver name<br>\r\n{giftcard_code} Gift card code<br>', 1, 0);
