						</tbody>                                \r\n								</table>                            </td>                        \r\n						</tr>                    \r\n					</tbody>                \r\n				</table>            </td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{learner_name} Learner name<br />\r\n{teacher_name} Teacher name<br />\r\n{class_lesson_name} Class or lesson name<br />\r\n{schedule_date} Scheduled on<br />\r\n{start_time} Start time<br />\r\n{end_time} End time<br />\r\n{learner_comment} Learner comment<br />\r\n{session_type} Class or Lesson<br />', 1, 0),
