                               \n								</table>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>    \n	</tbody>\n</table>', '{learner_name} Learner Name<br>\n{teacher_name} Teacher Name<br>\n{session_type} Class or Lesson <br>\n{class_lesson_name} Class Name or Lesson Name <br>\n{learner_comment} Learner comment<br>\n{schedule_date} Scheduled date<br>\n{start_time} Start time<br>\n{end_time} End Time<br>', 1, 0);
