(1, 'Teacher Profile info bar', 1, 1, '<div class=\"infobar__list-content\">\r\n										<ol>\r\n											<li>Profile needs to be 80% completed</li>\r\n											<li>You have to complete lorem ipsum dolar summit text</li>\r\n											<li>After verify all the details you have to mark availbility in calendar section.</li>\r\n										</ol>\r\n									</div>'),
(2, 'We make language learning easy & simpler', 2, 1, '<section class=\"section section--services\"><div class=\"container container--narrow\"><div class=\"section__head\"><h2>We make language learning easy &amp; simpler</h2></div><div class=\"section__body\"><div class=\"row\"><div class=\"col-md-6\"><div class=\"service\"><div class=\"service__media\"><img src=\"/images/120x120_1.png\" alt=\"\" style=\"float: none; margin: 0px; width: 60px; height: 60px;\" /></div><div class=\"service__content\"><h3>Professional Tutors</h3><p>Choose from over a myriad of professional &amp; experienced teachers to be fluent in any language.</p></div></div></div><div class=\"col-md-6\"><div class=\"service\"><div class=\"service__media\"><img src=\"/images//120x120_2.png\" alt=\"\" style=\"float: none; margin: 0px; width: 60px; height: 60px;\" /></div><div class=\"service__content\"><h3>1-on-1 Live sessions</h3><p>Connect with your teachers via 1-on-1 live chat sessions and build a deeper understanding of a language.</p></div></div></div><div class=\"col-md-6\"><div class=\"service\"><div class=\"service__media\"><img src=\"/images/120x120_3.png\" alt=\"\" style=\"float: none; margin: 0px; width: 60px; height: 60px;\" /></div><div class=\"service__content\"><h3>Group Classes</h3><p>Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo</p></div></div></div><div class=\"col-md-6\"><div class=\"service\"><div class=\"service__media\"><img src=\"/images/120x120_4.png\" alt=\"\" style=\"float: none; margin: 0px; width: 60px; height: 60px;\" /></div><div class=\"service__content\"><h3>Convenience &amp; Flexibility</h3><p>Schedule lessons as per your availability and learn at your own pace with no constraints of time and place.</p></div></div></div></div></div></div></section>'),
(3, 'Browse tutor section', 3, 1, '    <section class=\"section section--cta\" style=\"background-image:url(images/cta.png);\">\r\n        <div class=\"container container--narrow\">\r\n            <div class=\"cta-content\">\r\n                <h2>Speak any language fluently with the help of professional tutors</h2>\r\n                <a class=\"btn btn--secondary btn--large\" href=\"teachers\">Browse Tutors</a>\r\n            </div>\r\n        </div>\r\n    </section>'),
(4, 'Contact Banner', 4, 1, '<div class=\"intro-head\"><h6 class=\"small-title\">Contact Us</h6><h2>Want to get in touch?<br> We would love to hear from you.</h2></div><div class=\"about-media\"><div class=\"media\"><img src=\"images/contact_hero.png\" alt=\"\"></div></div>'),
