div>\r\n                                    </div>\r\n                                    <div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n                                        <div class=\"step__content\">\r\n                                            <h3>Log in to start learning.</h3>\r\n                                            <p>Attend online lessons and start learning.</p>\r\n                                            <div class=\"step__actions\"><a\r\n                                                href=\"https://teach.yo-coach.com/admin/content-pages#\"\r\n                                                class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a\r\n                                                href=\"javascript:void(0)\"\r\n                                                data-src=\"https://www.youtube.com/embed/q_Fy8DceWZM?autoplay=1\"\r\n                                                class=\"btn-video play-video\">\r\n                                                <svg class=\"icon icon--play\">\r\n                                                    <use xlink:href=\"images/sprite.yo-coach.svg#play\"></use>\r\n                                                </svg>&nbsp;Watch Video</a></div>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>');
