(10, 1, 'How To Start Learning?', '\r\n<section class=\"section section--step\"> \r\n	<div class=\"container container--narrow\"> \r\n		<div class=\"section__head\"> \r\n			<h2>How to start learning with Yo!Coach?</h2> </div> \r\n		<div class=\"section__body\"> \r\n			<div class=\"step-wrapper\"> \r\n				<div class=\"step-container__head\"> \r\n					<div class=\"step-tabs slider-tabs--js\"> \r\n						<div> \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">01.&nbsp;</span><span class=\"slider-tabs__label\">Search</span></button> </div> \r\n						<div> \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">02.&nbsp;</span><span class=\"slider-tabs__label\">Book</span></button> </div> \r\n						<div> \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">03.&nbsp;</span><span class=\"slider-tabs__label\">Learn</span></button> </div> </div> </div> \r\n				<div class=\"step-container__body\"> \r\n					<div class=\"step-slider step-slider-js\"> \r\n						<div> \r\n							<div class=\"step\"> \r\n								<div class=\"row \"> \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\"> \r\n										<div class=\"step__inner\"> \r\n											<div class=\"step__media\"><img src=\"/image/editor-image/1650021362-search.png\" alt=\"Search through hundreds of best teachers\" /></div> </div> </div> \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\"> \r\n										<div class=\"step__content\"> \r\n											<h3>&nbsp;</h3>\r\n											<h3>Search through hundreds of best teachers</h3> \r\n											<p>Use filters like price, language, proficiency, subject, location, to\r\n search for your preferred teacher.</p> \r\n											<div class=\"step__actions\"><a href=\"/teachers\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div> </div> </div> </div> </div> </div> \r\n						<div> \r\n							<div class=\"step\"> \r\n								<div class=\"row \"> \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\"> \r\n										<div class=\"step__inner\"> \r\n											<div class=\"step__media\"><img src=\"/image/editor-image/1650021522-Book.png\" alt=\"Book lessons with the best teacher for you\" /></div> </div> </div> \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\"> \r\n										<div class=\"step__content\"> \r\n											<h3>&nbsp;</h3>\r\n											<h3>Book lessons with the best teacher for you</h3> \r\n											<p>Go through the teacher’s profile and book a lesson after making the\r\n payment.</p> \r\n											<div class=\"step__actions\"><a href=\"/teachers\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div> </div> </div> </div> </div> </div> \r\n						<div> \r\n							<div class=\"step\"> \r\n								<div class=\"row \"> \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\"> \r\n										<div class=\"step__inner\"> \r\n											<div class=\"step__media\"><img src=\"/image/editor-image/1650021648-learn.png\" alt=\"Log in to start learning.\" /></div> </div> </div> \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\"> \r\n										<div class=\"step__content\"> \r\n											<h3>&nbsp;</h3>\r\n											<h3>Log in to start learning.</h3> \r\n											<p>Attend online lessons and start learning.</p> \r\n											<div class=\"step__actions\"><a href=\"/teachers\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div> </div> </div> </div> </div> </div> </div> </div> </div> </div> </div></section>'),
(10, 2, 'How To Start Learning?', '<section class=\"section section--step\">\r\n <div class=\"container container--narrow\">\r\n <div class=\"section__head\">\r\n <h2>How to start learning with Yo!Coach?</h2>\r\n </div>\r\n <div class=\"section__body\">\r\n <div class=\"step-wrapper\">\r\n <div class=\"step-container__head\">\r\n <div class=\"step-tabs slider-tabs--js\">\r\n <div>\r\n <button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">01.&nbsp;</span><span\r\n class=\"slider-tabs__label\">Search</span></button>\r\n </div>\r\n <div>\r\n <button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">02.&nbsp;</span><span\r\n class=\"slider-tabs__label\">Book</span></button>\r\n </div>\r\n <div>\r\n <button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">03.&nbsp;</span><span\r\n class=\"slider-tabs__label\">Learn</span></button>\r\n </div>\r\n </div>\r\n </div>\r\n <div class=\"step-container__body\">\r\n <div class=\"step-slider step-slider-js\">\r\n <div>\r\n <div class=\"step\">\r\n <div class=\"row \">\r\n <div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n <div class=\"step__inner\">\r\n <div class=\"step__media\"><img\r\n src=\"/images/step-1.png\" alt=\"\" /></div>\r\n </div>\r\n </div>\r\n <div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n <div class=\"step__content\">\r\n <h3>Search through hundreds of best teachers</h3>\r\n <p>Use filters like price, language, proficiency, subject, location, to\r\n search for your preferred teacher.</p>\r\n <div class=\"step__actions\"><a\r\n href=\"/teachers\"\r\n class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n <div>\r\n <div class=\"step\">\r\n <div class=\"row \">\r\n <div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n <div class=\"step__inner\">\r\n <div class=\"step__media\"><img\r\n src=\"/images/step-2.png\" alt=\"\" /></div>\r\n </div>\r\n </div>\r\n <div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n <div class=\"step__content\">\r\n <h3>Book lessons with the best teacher for you</h3>\r\n <p>Go through the teacher&rsquo;s profile and book a lesson after making the\r\n payment.</p>\r\n <div class=\"step__actions\"><a\r\n href=\"/teachers\"\r\n class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n <div>\r\n <div class=\"step\">\r\n <div class=\"row \">\r\n <div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n <div class=\"step__inner\">\r\n <div class=\"step__media\"><img\r\n src=\"/images/step-3.png\" alt=\"\" /></div>\r\n </div>\r\n </div>\r\n <div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n <div class=\"step__content\">\r\n <h3>Log in to start learning.</h3>\r\n <p>Attend online lessons and start learning.</p>\r\n <div class=\"step__actions\"><a\r\n href=\"/teachers\"\r\n class=\"btn btn--primary\">Browse Tutors</a>&nbsp;</div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n </div>\r\n</section>');
