(26, 1, 0, 'Learn-Portuguese-in-120-Minutes-ALL-the-Portuguese-Phrases-You-Need-to-Get-Started-1651635600-16-3', 'Learn Portuguese in 120 Minutes - ALL the Portuguese Phrases You Need to Get Started', 'In this class, we will teach you the most common 571 Portuguese words that you must know if you\'re a an absolute beginner. This is THE place to start if you want to learn Portuguese, and improve both your listening and speaking skills.', 16, 6, 120, '2022-05-04 03:40:00', '2022-05-04 05:40:00', NULL, NULL, 19, 0, 72.00, 1, 0, '2022-05-04 02:40:00'),
