(32, 1, 0, '171-Portuguese-words-to-hold-Everyday-Conversation-Learn-Portuguese-through-English-1658243400-18-2', '171 Portuguese words to hold Everyday Conversation - Learn Portuguese through English', 'Learn 171 Portuguese words that will help you in everyday conversation. Knowing these words will not only improve your Portuguese vocabulary but will make you feel more confident in holding conversations in Portuguese in various situations. This is a well-designed course for the development of the Portuguese Language. This course will be helpful for the new learner of the Portuguese Language. With the help of this course, a learner can learn Portuguese Vocabulary, sentence structure, and the story of the Portuguese language.', 18, 6, 60, '2022-07-19 15:10:00', '2022-07-19 16:10:00', NULL, NULL, 15, 1, 55.00, 1, 0, '2022-07-19 14:10:00'),
(33, 1, 0, 'Learn-Japanese-in-30-minutes!-The-TOP-250-Most-Important-Words-1644904800-20-1', 'Learn Japanese in 30 minutes! The TOP 250 Most Important Words', 'This Lesson will help you learn the top 250 most important words in the Japanese language. These 250 words make up to 47% of words in daily conversations. We’ve organized them in groups to make them much easier to learn. If you really want to master them, it is a good idea to watch the video a couple of times or even better, take our exercises in our program.', 20, 8, 30, '2022-02-15 06:00:00', '2022-02-15 06:30:00', NULL, NULL, 15, 0, 34.00, 1, 0, '2022-02-15 05:00:00'),
