INSERT INTO `tbl_payment_methods` (`pmethod_id`, `pmethod_type`, `pmethod_code`, `pmethod_active`, `pmethod_order`, `pmethod_info`, `pmethod_fees`, `pmethod_settings`) VALUES
(1, 1, 'AuthorizePay', 1, 4, '<a href=\"https://developer.authorize.net/\">Developer Guides</a>\r\nAccept payments anytime, anywhere\r\nAccept credit cards, contactless payments, and eChecks in person and on the go. Contact us to learn more by calling 1-888-323-4289.\r\n<a href=\"https://www.youtube.com/watch?v=Qbi6WKPK8nQ&feature=emb_imp_woyt\">Learn how payments work</a>\r\nCurious about the payments process? Learn what happens when your customers swipe or enter their card to how the money reaches your account.', NULL, '[{\"key\": \"login_id\", \"type\": \"text\", \"value\": \"Login ID\"}, {\"key\": \"transaction_key\", \"type\": \"text\", \"value\": \"Transaction Key\"}, {\"key\": \"md5_hash\", \"type\": \"text\", \"value\": \"MD5 Hash\"}]'),
(2, 1, 'PaypalStandardPay', 1, 5, '<a href=\"https://developer.paypal.com/api/nvp-soap/paypal-payments-standard/web/\">Developer Guides</a>\r\nPayPal Payments Standard provides payment buttons as a quick and easy solution for accepting payments. Payment buttons let you securely accept credit card, debit card, and PayPal payments on your website from any mobile device, tablet, or PC.\r\nAvailability\r\nYou must have a PayPal Business or PayPal Premier account to create payment buttons. There are no setup fees or cancellation fees. See PayPal Merchant Fees for information about per-transaction fees.\r\nUse payment buttons in any country where PayPal is accepted. You can hold multiple currency balances in your PayPal account or convert a currency balance at competitive rates. International fees are also provided on the PayPal Merchant Fees page.', NULL, '[{\"key\": \"merchant_email\", \"type\": \"text\", \"value\": \"Merchant Email\"}]'),
(3, 1, 'StripePay', 1, 3, '<a href=\"https://stripe.com/docs\">Developer Guides</a>\r\nPayments infrastructure for the internet\r\nMillions of businesses of all sizes – from startups to large enterprises – use Stripe\'s software and APIs to accept payments, send payouts, and manage their businesses online.\r\nA fully integrated suite of payments products\r\nWe bring together everything that’s required to build websites and apps that accept payments and send payouts globally. Stripe’s products power payments for online and in-person retailers, subscriptions businesses, software platforms and marketplaces, and everything in between.', NULL, '[{\"key\": \"secret_key\", \"type\": \"text\", \"value\": \"Secret Key\"}, {\"key\": \"publishable_key\", \"type\": \"text\", \"value\": \"Publishable Key\"}]'),
(4, 2, 'PaypalPayout', 1, 9, '<a href=\"https://developer.paypal.com/docs/payouts/standard/payouts-web/\">Developer Guides</a>\r\nNeed to pay multiple recipients? PayPal offers everything from basic payouts to enterprise-level solutions.\r\nChoose a payouts solution\r\nPayouts Web enables you to send up to 5,000 payments per file using a .csv (comma separated value) file. This page explains everything you need to know about making payouts using Payouts Web.\r\n\r\n1. Enable Payouts Web\r\n2. Create a payment file\r\n3. Upload a payment file\r\n4. Review transaction details', '{\"fee\": 10, \"type\": 1}', '[{\"key\": \"client_id\", \"type\": \"text\", \"value\": \"Client ID\"}, {\"key\": \"client_secret\", \"type\": \"text\", \"value\": \"Client Secret\"}]'),
(5, 2, 'BankPayout', 1, 10, 'Bank Payout means the amount of the Available Balance that may be paid out in cash to the Executive Officer for each Plan Year. ', '{\"fee\": 10, \"type\": 2}', NULL),
(7, 1, 'PayGatePay', 1, 7, '<a href=\"https://docs.paygate.co.za/#payweb-3\">Developer Guides</a>\r\nIntroduction\r\nPayWeb is a secure payment system hosted by PayGate. A single integration to PayWeb gives you access to multiple payment methods. PayGate is a PCI compliant payment service provider.\r\n\r\nPayGate is continually adding to the list of available payment methods. Please contact the PayGate Support team (email: support@paygate.co.za) to confirm which payment methods are available in your locale.', NULL, '[{\"key\": \"paygateId\", \"type\": \"text\", \"value\": \"Paygateid\"}, {\"key\": \"encryptionKey\", \"type\": \"text\", \"value\": \"Encryptionkey\"}]'),
(8, 1, 'PaystackPay', 1, 8, '<a href=\"https://paystack.com/developers\">Developer Guides</a>\r\nPaystack is the payment processor of choice for some of the fastest-growing businesses in Nigeria. Here\'re 12 reasons why.\r\nStart accepting payments instantly\r\nSimple, transparent pricing\r\nDelight customers with a seamless payments experience\r\nEnjoy phenomenal transaction success rates\r\nProtect yourself and your customers with advanced fraud detection\r\nBuild custom payments experiences with well-documented APIs\r\nUnderstand exactly how your business is performing\r\nGet your money within 24 hours\r\nGet paid by customers from anywhere in the world\r\nGet attentive, empathetic help 24/7\r\nA modern, beautiful payments experience\r\nA team that\'s obsessed about your growth', NULL, '[{\"key\": \"secret_key\", \"type\": \"text\", \"value\": \"Secret Key\"}, {\"key\": \"public_key\", \"type\": \"text\", \"value\": \"Public Key\"}]'),
(9, 1, 'WalletPay', 1, 1, 'A digital wallet, also known as e-wallet, is an electronic device, online service, or software program that allows one party to make electronic transactions with another party bartering digital currency units for goods and services.', NULL, NULL),
(10, 1, 'BankTransferPay', 1, 2, 'Bank transfer (or wire transfer) is a payment method that allows consumers to transfer money to a bank account around the world. \r\nThe consumer is provided with a unique reference number and details of the bank account where they can make their payment.', NULL, '[{\"key\": \"book_before_hours\", \"type\": \"text\", \"value\": \"4\"}, {\"key\": \"account_details\", \"type\": \"textarea\", \"value\": \"Bank code (Bankleitzahl): 20811008\\r\\ndomestic account number: 1039531801\\r\\nIBAN: AL90208110080000001039531801\"}]');
